import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import Footer from '../../components/Footer';
import { useNavigate } from 'react-router-dom';

const ManageDevice = ({ userInfo, handleLogout }) => {
    const navigate = useNavigate();

    const handleAddDeviceList = () => {
        navigate('/superadmin/AddManageDevice');
    };

    const handleViewDeviceList = () => {
        navigate('/superadmin/ViewManageDevice');
    };

    const handleEditDeviceList = () => {
        navigate('/superadmin/EditManageDevice');
    };

    const handleAssignReseller = () => {
        navigate('/superadmin/AssignReseller');
    };

    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [posts, setPosts] = useState([]);

    // Get table data
    useEffect(() => {
        const url = `/superadmin/FetchCharger`;
        axios.get(url)
            .then((res) => {
                setData(res.data);
                setLoading(false);
            })
            .catch((err) => {
                console.error('Error fetching data:', err);
                setError('Error fetching data. Please try again.');
                setLoading(false);
            });
    }, []);

    // Search data 
    const handleSearchInputChange = (e) => {
        const inputValue = e.target.value.toUpperCase();
        // Ensure data is an array before filtering
        if (Array.isArray(data)) {
            const filteredData = data.filter((item) =>
                item.charger_id.toUpperCase().includes(inputValue)
            );
            // Update the search state with the filtered results
            setPosts(filteredData);
        }
    };

    return (
        <div className='container-scroller'>
            <Header userInfo={userInfo} handleLogout={handleLogout} />
            <div className="container-fluid page-body-wrapper">
                <Sidebar />
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Manage Device</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={handleAddDeviceList}>Create</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div className="row">
                                            <div className="col-md-12 grid-margin">
                                                <div className="row">
                                                    <div className="col-4 col-xl-8">
                                                        <h4 className="card-title" style={{ paddingTop: '10px' }}>List Of Chargers</h4>
                                                    </div>
                                                    <div className="col-8 col-xl-4">
                                                        <div className="input-group">
                                                            <div className="input-group-prepend hover-cursor" id="navbar-search-icon">
                                                                <span className="input-group-text" id="search">
                                                                    <i className="icon-search"></i>
                                                                </span>
                                                            </div>
                                                            <input type="text" className="form-control" placeholder="Search now" aria-label="search" aria-describedby="search" autoComplete="off" onChange={handleSearchInputChange} />
                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                        <div className="table-responsive">
                                            <table className="table table-striped">
                                                <thead style={{ textAlign: 'center' }}>
                                                    <tr>
                                                        <th>Sl.No</th>
                                                        <th>Charger ID</th>
                                                        <th>Model</th>
                                                        <th>Type</th>
                                                        <th>Gun Connetor</th>
                                                        <th>Max Current</th>
                                                        <th>Created By</th>
                                                        <th>Created Date</th>
                                                        <th>Status</th>
                                                        <th>Option</th>
                                                    </tr>
                                                </thead>
                                                <tbody style={{ textAlign: 'center' }}>
                                                    {loading ? (
                                                        <tr>
                                                            <td colSpan="10" style={{ marginTop: '50px', textAlign: 'center' }}>Loading...</td>
                                                        </tr>
                                                    ) : error ? (
                                                        <tr>
                                                            <td colSpan="10" style={{ marginTop: '50px', textAlign: 'center' }}>Error: {error}</td>
                                                        </tr>
                                                    ) : (
                                                        Array.isArray(posts) && posts.length > 0 ? (
                                                            posts.map((dataItem, index) => (
                                                                <tr key={index}>
                                                                    <td>{index + 1}</td>
                                                                    <td>{dataItem.charger_id}</td>
                                                                    <td>{dataItem.model}</td>
                                                                    <td>{dataItem.type}</td>
                                                                    <td>{dataItem.gun_connector}</td>
                                                                    <td>{dataItem.max_current}</td>
                                                                    <td>{dataItem.created_by}</td>
                                                                    <td>{dataItem.created_date}</td>
                                                                    <td>{dataItem.status ? 'Ok' : 'Not Ok'}</td>
                                                                    <td>
                                                                        <button type="button" className="btn btn-outline-success btn-icon-text" onClick={handleViewDeviceList} style={{ marginBottom: '10px', marginRight: '10px' }}>
                                                                            <i className="mdi mdi-eye"></i> View
                                                                        </button>
                                                                        <button type="button" className="btn btn-outline-primary btn-icon-text" onClick={handleEditDeviceList} style={{ marginBottom: '10px', marginRight: '10px' }}>
                                                                            <i className="mdi mdi-pencil btn-icon-prepend"></i> Edit
                                                                        </button><br />
                                                                        <button type="button" className="btn btn-outline-warning btn-icon-text" onClick={handleAssignReseller} style={{ marginBottom: '10px', marginRight: '10px' }}>
                                                                            <i className="ti-file btn-icon-prepend"></i> Assign to Reseller
                                                                        </button>
                                                                    </td>
                                                                </tr>
                                                            ))
                                                        ) : (
                                                            <tr>
                                                                <td colSpan="10" style={{ marginTop: '50px', textAlign: 'center' }}>No devices found.</td>
                                                            </tr>
                                                        )
                                                    )}
                                                </tbody>
                                            </table>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <Footer />
                </div>
            </div>
        </div>
    )
}

export default ManageDevice;
